} from 'react';
import logo from './logo.svg';
import './App.css';

const list1 = ['keroro', 'gururu']

const list2 = ['tamama', 'doraemon']

function App() {
  const [lists, setList] = useState(list1)

  useEffect(function () {
    setTimeout(function () {
      setList(list2)
    }, 3000);

  }, [])

  return ( <
    div className = "App" >
    <
    header className = "App-header" >
    <
    img src = {
      logo
    }
    className = "App-logo"
    alt = "logo" / >
    <
    p >
    Aqu√≠ comienza una nueva era, la de keroro <
    /p> {
      lists.map(name => < p > {
            name
          } < /p>)
        } <
        /header> <
        /div>
    );
  }

  export default App;
